import React, { useEffect } from "react";
import Myauto from "./myauto";
import Header from "./header";
import Navbar from "./navbar";
import Main from "./main";
import data4 from "./data4.json";
import Filter from "./Filter";
import { useState } from "react";
import "./App1.css";
import "./App.css";

function App() {
  let IDs: number[] = [
    91350842, 92060138, 92836546, 92836546, 92835750, 86946439, 85990507,
    92792538,
  ];
  const items: object[] = data4.data.items;

  const [link, setLink] = useState(
    "https://www.myauto.ge/ka/s/manqanebi?vehicleType=0&bargainType=&mansNModels=&currId=1&mileageType=1&page1"
  );

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch(link);
        const data = await response.json();

        console.log(data);
      } catch (error) {
        console.log(error);
      }
    };

    fetchData();
  }, [link]);

  const [currency, setCurrency] = useState<string>("GEL");

  return (
    <>
      <Header />
      <Myauto />
      <Filter selectCurrency={setCurrency} currency={currency} />
      <Navbar />
      <Main IDs={IDs} selectCurrency={setCurrency} currency={currency} />
    </>
  );
}

export default App;
